INSERT INTO `services` (`id`, `user_id`, `category_id`, `title`, `description`, `location`, `map`, `created_at`, `updated_at`, `popular`, `price`) VALUES
(17,	1,	1,	'The Smokery',	'Immerse yourself in an exceptional atmosphere with a breathtaking view of the Red Sea and the New Marina. As high season arrives, the venue transforms into a vibrant nightspot. The resident DJ spins the decks, creating an unforgettable ambiance for your waterfront dining experience.',	NULL,	NULL,	'2024-04-04 11:10:39',	'2024-04-05 02:33:42',	0,	NULL),
(18,	1,	3,	'Travel - Cairo',	'From El Gouna to Cairo, solo or with friends, iConcierge offers you personalized 1 to 2-day trips. Immerse yourself in history with a private guide, visiting one of the 7 wonders of the ancient world: the Pyramids of Giza. Your adventure will continue at the Egyptian Museum, where you will be exploring the ancient Egyptian civilization. This trip won’t be complete without visiting the vibrant Khan El Khalili, the largest bazaar in the Arab world.',	NULL,	NULL,	'2024-04-04 12:12:20',	'2024-04-04 12:12:20',	0,	NULL),
(19,	1,	3,	'Travel - Luxor',	'Explore Luxor\'s wonders on a 1 or 2-day trip from El Gouna! Witness the towering Colossi of Memnon, explore the magnificent Karnak Temple, and descend into the tombs of pharaohs in the Valley of the Kings (or Queens). Top it off with Hatshepsut Temple, a wonder carved into cliffs.',	NULL,	NULL,	'2024-04-04 12:15:30',	'2024-04-04 12:15:30',	0,	NULL),
(20,	1,	1,	'Mer Bey',	'Travel back to Beirut\'s past through delicious Lebanese cuisine at Mer Bey, El Gouna\'s fine dining restaurant and lounge bar. It’s the perfect place for you to share an authentic experience with family, friends, or colleagues while enjoying the breathtaking Marina.',	NULL,	'Open location in maps',	'2024-04-04 12:27:39',	'2024-04-04 12:27:39',	0,	NULL),
(21,	1,	1,	'Zouni Beach',	'This family-friendly beach offers fun activities for kids, delicious food, and unforgettable weekend sunset sessions. Their menu caters to the whole family, so you can relax and enjoy refreshing salads, juicy burgers, or lighter options. Your second home by the sea is at Mangroovy Residence.',	NULL,	NULL,	'2024-04-04 12:32:11',	'2024-04-04 12:32:11',	0,	NULL),
(22,	1,	1,	'Barten',	'Specializing in Japanese cuisine, Barten is dedicated to creating culinary masterpieces, and only the most talented chefs are entrusted with crafting Barten\'s exquisite dishes. Choose to dine indoors, bathed in the cool glow of modern design, or take in the vibrant energy of the El Gouna Marina with al fresco seating.',	NULL,	NULL,	'2024-04-04 12:36:27',	'2024-04-04 12:36:27',	0,	NULL),
(23,	1,	1,	'Chicha',	'Chicha has been a culinary force in El Gouna since its debut in 2019. It\'s become a top destination, renowned for its vibrant atmosphere and delicious Latin cuisine, making it a great choice for a fun and flavorful evening.',	NULL,	NULL,	'2024-04-04 12:41:45',	'2024-04-04 12:41:45',	0,	NULL),
(24,	1,	8,	'Steigenberger Hotel Spa',	'Immerse yourself in the tranquil ambiance, surrounded by calming music and oriental vibes. Steigenberger Hotel Spa offers a comprehensive menu of rejuvenating treatments, including a variety of massages, revitalizing spa rituals, and traditional refreshing Hammam. Whether you seek deep relaxation or targeted muscle relief, we promise you an experience that nourishes both body and mind.',	NULL,	NULL,	'2024-04-04 12:50:32',	'2024-04-04 12:50:32',	0,	NULL),
(25,	1,	8,	'Casa Cook Hotel Spa',	'Embrace a holistic approach to wellness at the Casa Cook Hotel Spa in El Gouna. They offer a menu of refreshing treatments, including a variety of massage therapies, facials, body treatments, and traditional hammam experiences. Whether you crave deep muscle relief or a revitalizing glow, this place offers a personalized path to full relaxation.',	NULL,	NULL,	'2024-04-04 13:01:08',	'2024-04-04 13:01:08',	0,	NULL),
(26,	1,	8,	'Lagoon Spa',	'It’s time for you to unwind and rejuvenate at El Gouna\'s Lagoon Spa offering a set of pampering treatments designed to melt away stress and restore balance.  Indulge in a classic massage or embark on a revitalizing spa program featuring traditional hammam rituals, invigorating body scrubs, and the soothing embrace of the jacuzzi.',	NULL,	NULL,	'2024-04-04 13:05:45',	'2024-04-04 13:05:45',	0,	NULL),
(27,	1,	8,	'The Spa',	'This serene place combines ancient Asian wisdom with modern luxury, offering a transformative spa journey beyond indulgence.  Their expert team, using organic ingredients, crafts bespoke experiences designed to awaken your senses with Asia\'s time-tested traditions, encompassing massages, body rituals, and facial treatments.',	NULL,	NULL,	'2024-04-04 13:08:58',	'2024-04-04 13:08:58',	0,	NULL),
(28,	1,	8,	'Prima Salon',	'Pamper yourself at Prima Salon, El Gouna\'s unisex one-stop shop to all your beauty needs. They offer haircuts, treatments, manicures & pedicures (gel polish too!), ink tattoos, hair extensions, hair removal, microblading, and even dreadlocks. Look & feel your best – all under one roof!',	NULL,	NULL,	'2024-04-04 13:21:51',	'2024-04-04 13:21:51',	0,	NULL),
(29,	1,	8,	'ElGouna Golf Club',	NULL,	NULL,	NULL,	'2024-04-04 13:31:31',	'2024-04-04 13:31:31',	0,	NULL),
(30,	1,	8,	'Ancient Sands Golf Club',	NULL,	NULL,	NULL,	'2024-04-04 13:33:06',	'2024-04-04 13:33:06',	0,	NULL),
(31,	1,	8,	'Padel Tennis',	'Padel is the ultimate blend of action, fun, and social connection. This exciting sport, played on a court with walls, is perfect for all ages and skill levels. Whether you\'re a pro athlete or a beginner, Padel\'s easy-to-learn nature allows you to pick it up quickly and have fun – all under the El Gouna sun!',	NULL,	NULL,	'2024-04-04 13:34:34',	'2024-04-04 13:34:34',	0,	NULL),
(32,	1,	8,	'Go Kart',	'Channel your inner F1 driver with no prior driving experience needed! El Gouna\'s Go-Karting track lets you experience the thrill of high-speed racing in a safe and controlled environment. Get ready to unleash your competitive spirit on the El Gouna raceway.',	NULL,	NULL,	'2024-04-04 13:35:34',	'2024-04-04 13:35:34',	0,	NULL),
(33,	1,	2,	'Mercedes V250 2022',	'This spacious vehicle comfortably seats up to six passengers, allowing personal space for everyone on board. The V250\'s expansive interior allows for luggage and gear, making it ideal for families, groups, or anyone who desires a touch of VIP treatment.',	NULL,	NULL,	'2024-04-04 13:38:37',	'2024-04-04 13:38:37',	0,	NULL),
(34,	1,	2,	'Mercedes E200 2022',	'This luxurious sedan is perfect for travelers seeking a touch of elegance on their journeys. The E200 provides a comfortable ride for up to four passengers, making it ideal for couples, small groups, or those who appreciate a touch of refined luxury.',	NULL,	NULL,	'2024-04-04 13:40:44',	'2024-04-04 13:40:44',	0,	NULL),
(35,	1,	1,	'Arabesque',	'Embark on a culinary journey through Egypt at Arabesque Restaurant!  Located in the heart of El Gouna, this vibrant place has an ambiance that complements the aromatic tagines, savory kebabs, and a menu crafted to honor the country\'s culinary heritage.  Whether you\'re a local or a traveler, Arabesque promises an unforgettable dining experience, transporting you to the heart of Egyptian cuisine.',	NULL,	NULL,	'2024-04-04 13:43:51',	'2024-04-04 13:43:51',	0,	NULL),
(38,	1,	10,	'Holix',	'Need to stock up before hitting the waves? This one-stop shop caters to all your watersports adventures, offering top-notch equipment and accessories for kitesurfing, wakeboarding, stand-up paddleboarding, kayaking, surfing, and sailing. Browse their extensive selection of wetsuits, quick-dry gear, and stylish lifestyle apparel.',	NULL,	NULL,	'2024-04-05 00:16:32',	'2024-04-05 00:16:32',	0,	NULL),
(39,	1,	4,	'Ocean Flyer - 33 ft',	'Set sail on luxury with the Ocean Flyer, El Gouna\'s crown jewel of yacht rentals measuring 33 feet. Accommodating up to 10 guests, the Ocean Flyer offers the ultimate in comfort and flexibility with a unique feature – a round glass viewing area to peek into the crystal-clear waters of the Red Sea.',	NULL,	NULL,	'2024-04-05 00:23:02',	'2024-04-05 12:11:08',	0,	NULL),
(40,	1,	4,	'Viga Boat - 19.6 ft',	'This sleek and powerful boat, measuring 19.6 ft and boasting a 175 HP engine, provides the perfect platform for exploring the turquoise waters surrounding El Gouna. Ideal for smaller groups, The Viga Boat is perfect for indulging in watersports, creating memories that will last a lifetime.',	NULL,	NULL,	'2024-04-05 00:31:02',	'2024-04-05 12:12:56',	0,	NULL),
(41,	1,	4,	'RIB Boat - 31 ft',	'This adrenaline-pumping boat stretches across 9.6 meters and is equipped with twin 200 HP engines, promising an exhilarating ride on the Red Sea. Crank up the tunes on the sound system and create unforgettable memories in the water with your family or friends',	NULL,	NULL,	'2024-04-05 00:34:05',	'2024-04-05 12:11:55',	0,	NULL),
(42,	1,	15,	'Flitescooter',	'For those craving water sports adventures, we’ve got you covered with the exhilarating Flitescooter. Imagine the thrill of effortlessly gliding above the water –  no experience required! Perfect for families, resorts, and yacht owners, this is a fun and eco-friendly way to experience the magic of El Gouna.',	NULL,	NULL,	'2024-04-05 02:02:28',	'2024-04-05 02:02:28',	0,	NULL),
(43,	1,	15,	'Safari',	'Ready for a 40km adrenaline rush through the magnificent Dry Canyon? You will get to choose between a Quad Bike or Dune Buggy for a scenic Safari from El Gouna. Then unwind at a Bedouin camp with refreshing drinks, fruitful shisha and fun camel rides.',	NULL,	NULL,	'2024-04-05 02:03:38',	'2024-04-05 02:03:38',	0,	NULL),
(44,	1,	15,	'Jeep Trip',	'This isn\'t your usual Jeep Safari trip. Hop aboard a rugged 4x4 and embark on a 40km journey through the mystical Dry Canyon, also known as Wadi Belli. Explore ancient fossils of corals and seashells. Then, immerse yourself in Bedouin culture with a camel ride, a taste of their traditional tea, and definitely a puff of shisha.',	NULL,	NULL,	'2024-04-05 02:04:14',	'2024-04-05 02:04:14',	0,	NULL),
(45,	1,	15,	'HorseBack Riding',	'It’s time for a Horseback Riding adventure where you get to discover El Gouna\'s scenic north from a unique perspective, tailored for all levels. Safety and animal welfare are our top priorities, ensuring both your comfort and the well-being of our magnificent horses.   Our experienced guides will lead small groups, allowing for personalized attention that exceeds your expectations.',	NULL,	NULL,	'2024-04-05 02:05:19',	'2024-04-05 02:05:19',	0,	NULL),
(46,	1,	15,	'Hiking',	'Unleash your inner adventurer with a 4x4 offroad adventure. Explore El Gouna\'s mountains, hike canyons, and indulge in a Bedouin hospitality with a sunset bonfire and starlit dinner.',	NULL,	NULL,	'2024-04-05 02:13:07',	'2024-04-05 02:13:07',	0,	NULL),
(47,	1,	15,	'Tawila Island',	'Indulge in unparalleled luxury at our brand new 5-star resort, featuring luxurious Water Bungalows with private pools and exquisite Beach Bungalows offering direct beach access.  Unwind in spacious suites, savor world-class dining, and experience unmatched service – Tawila Island, where tranquility meets adventure.',	NULL,	NULL,	'2024-04-05 02:13:47',	'2024-04-05 02:13:47',	0,	NULL),
(48,	1,	11,	'Bodyguards',	'Whether you require close protection, travel security, or event security, iConcierge provides highly trained and professional bodyguards to ensure your safety and well-being throughout your stay, allowing you to relax and focus on creating unforgettable memories.',	NULL,	NULL,	'2024-04-05 02:20:38',	'2024-04-05 11:19:11',	0,	NULL),
(49,	1,	7,	'Smokery Beach',	'Located right next to El Gouna\'s New Marina and facing the open water, this unique beach spot offers a year-round spot for relaxation. Enjoy delicious food and refreshing drinks at the beach bar and restaurant, all while grooving to happy beats.',	NULL,	NULL,	'2024-04-05 02:22:01',	'2024-04-05 02:34:44',	0,	NULL),
(50,	1,	7,	'Zouni beach',	'This beach haven offers crystal-clear waters, a soft sandy shore, and a relaxed atmosphere.  Indulge in delicious international cuisine from their restaurant, or simply unwind with a refreshing drink.',	NULL,	NULL,	'2024-04-05 02:23:51',	'2024-04-05 02:23:51',	0,	NULL),
(51,	1,	1,	'Boho Cafe',	'Unwind in a modern, boho-chic interior with stunning marina views at Boho Cafe. Whether you\'re a vegetarian, vegan, or following a gluten-free diet, you\'ll find a wide variety of satisfying options using the freshest ingredients from local markets. Boho Cafe goes beyond just healthy food; it\'s a mindful experience.',	NULL,	NULL,	'2024-04-05 11:36:59',	'2024-04-05 11:36:59',	0,	NULL),
(52,	1,	1,	'Bongoyo',	'Bongoyo, located in the heart of El Gouna\'s downtown, will take you on a culinary adventure with a chef deeply inspired by the rich tapestry of African cuisine & flavors, turning them into a culinary canvas on your plate. Named after a Tanzanian island paradise, Bongoyo reflects simplicity and beauty in every bite.',	NULL,	NULL,	'2024-04-05 11:50:44',	'2024-04-05 11:50:44',	0,	NULL),
(53,	1,	1,	'El Bahr',	'El Bahr offers an unparalleled seafood experience right on the El Gouna coast. Savor the freshest Red Sea catches alongside a variety of tempting starters, all just steps from the water\'s edge. And Feel free to bring your own catch of the day - El Bahr\'s skilled chefs will prepare it to perfection for you, showcasing the true taste of the sea!',	NULL,	NULL,	'2024-04-05 11:54:37',	'2024-04-05 11:54:37',	0,	NULL),
(54,	1,	1,	'Harumaki  (DOWNTOWN)',	'Immerse yourself in a vibrant fine-dining experience featuring authentic Japanese Teppanyaki and sushi as fresh as the ocean breeze while witnessing the captivating art of Teppanyaki cooking live.  The elegant light wood and natural decor creates a refined atmosphere, with the vibrant Teppanyaki grill taking center stage.',	NULL,	NULL,	'2024-04-05 11:57:34',	'2024-04-05 11:57:44',	0,	NULL),
(55,	1,	1,	'La Plancha',	'Get ready for a dining experience unlike any other at La Plancha, the exciting new addition to Chicha\'s Group in El Gouna. This place is more than just a restaurant and live bar; it\'s a destination for unforgettable entertainment and delicious Mediterranean cuisine with a breathtaking beachfront view.',	NULL,	NULL,	'2024-04-05 12:02:01',	'2024-04-05 12:02:01',	0,	NULL),
(56,	1,	1,	'Le Restaurant',	'At Le Restaurant, in-house guests enjoy the freedom to dine whenever their heart desires, with no set meal times.  Savor a menu cooked with fresh, seasonal ingredients, or let their talented chef create your own dish. Choose your ideal setting – the comfortable room, the elegant dining room decorated with handpicked Art Deco pieces by Jules Leleu, or the shaded terrace overlooking the shimmering lagoon.',	NULL,	NULL,	'2024-04-05 12:08:25',	'2024-04-05 12:08:25',	0,	NULL),
(57,	1,	1,	'Marina Steakhouse',	'Craving sizzling steaks and fresh seafood with a view?  This renowned restaurant in the heart of El Gouna\'s bustling marina offers both breakfast and dinner to satisfy hotel guests and passersby.  Dine indoors among chic, contemporary surroundings or soak up the atmosphere on the terrace, shaded by vibrant bougainvillea.',	NULL,	NULL,	'2024-04-05 12:11:48',	'2024-04-05 12:11:48',	0,	NULL),
(58,	1,	1,	'Nihon',	'This rooftop has breathtaking sea views and a relaxed, sophisticated ambiance. Savor authentic Japanese cuisine prepared in a live kitchen, all while sipping expertly crafted drinks from the resident wine guru or mixologist.',	NULL,	NULL,	'2024-04-05 12:14:23',	'2024-04-05 12:14:23',	0,	NULL);
